import React, {Component} from 'react';
import {Image} from 'react-bootstrap';


class MonkeyInfo extends Component {

    render() {
		if (!this.props.content) {
			return null;
		}

		const { firstName, lastName,  title, role, company } = this.props.content;

	    return (
	      <div>
	        <Image style={{ width: '4rem' }} src="/assets/speak-no-evil-monkey.png" roundedCircle thumbnail />
	          <div>{firstName} {lastName}</div>
	          <div>{title}/{role}/{company}</div>
	      </div>
	    );
  } 
}


export default MonkeyInfo;
